import React from 'react';

function Header(){
    return(
        <div className="header">
            <div classNames="header-container">
                <div className="header-item">Bayboss, Baykom barkodlu otomatik satış sistemi, işletmenin stok ve cari sistemini kontrol altına alarak maddi zararları ve işgücü kayıplarını aza indirgemektedir.</div>
                <div className="header-item">Baykom Yazılım, kurumların ihtiyaç duydukları yazılımların hazırlanması konusunda da hizmet vermektedir. Baykom Yazılım, nitelikli yazılımcıları ve tecrübeli danışmanları ile firmanız için en iyi yazılımları üretmektedir.</div>
                <div className="header-item">
                    Size özel web tasarımlarımızla, ihtiyaçlarınızı karşılayacak en iyi hizmeti sunmaktayız. Kontrol Paneli bulunan siteler yapılmaktadır. Tüm tasarımlarımızda sınırsız destek ve güncelleme hizmetleride vermekteyiz.
                    </div>
            </div>
        </div>
    )
}

export default Header;
